import React from 'react';
import styles from './../Style/Components/Server.module.css';
type MyProps = { Name: string, id: string, Active: string, customClickEvent: Function, Self: boolean };
type MyState = { Picture: string };
class Server extends React.Component<MyProps, MyState> {
  public state: MyState;
  constructor(props) {
    super(props);
    this.state = {
      Picture: `${process.env.Storage_Url}/Servers/${this.props.id}/Icon`
    };
  }
  render() {
    return (
      <div 
        role="button"
        className={[
          styles.Container, 
          styles.Self
        ].join(' ')}
        onClick={
          (evt => this.props.customClickEvent(evt, this.props.id))
        }
        title={this.props.Name}
      >
        {
          this.props.Active == this.props.id && <div className={styles.Active}></div>
        }
        <picture className={styles.Icon}>
          <img className={styles.Icon_IMG} src={this.state.Picture} />
        </picture>
      </div>
    );
  }
}
export default Server;
